import {useState, useEffect, useCallback} from 'react';
import { Card, Box, Chip, Stack, IconButton} from '@mui/material';
import dayjs from 'dayjs'
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea, CardHeader } from '@mui/material';
import EmojiPeopleIcon from '@mui/icons-material/EmojiPeople';


export default function ParticipantesCard({data}) {
   

    
    
    
    
  return (
    <Card sx={{width:'100%'}}>
        
        <Box sx={{backgroundColor:'#b22834', color:'#fff', display:'flex', padding:2, justifyContent:'center'}}>
        <Typography  sx={{marginRight: 1}}>Participantes</Typography>
         
      <EmojiPeopleIcon/>
      </Box>
      
        <CardContent>
            <Box sx={{display:'flex',alignItems:'center',justifyContent:'center', padding: 0, height: 50}}>
            {data ? <Typography>participantes: {data[0].participantes}</Typography> :null}
          </Box>

        </CardContent>
        
      
    </Card>
  );
}
